async function deleteVerifiactionResult() {
  await clearDB();
}

test("getPageByFilter", async () => {
  const webhookEntities = await fillVerificationWebhook();
  const webhookResult = webhookEntities[0]!;
  a.equal(await verificationWebhookStore.getPageByFilter({
    conditions: {
      id: webhookResult.id
    },
    page: {
      size: 2,
      index: 0
    }
  }), {
    data: [webhookResult],
    currentIndex: 0,
    nextIndex: null,
    prevIndex: null,
    count: 1
  });
  for (let i = 0; i < webhookEntities.length; i++) {
    const pageSize = 3;
    const pageIndex = Math.floor(i / pageSize);
    const lastIndex = Math.ceil(webhookEntities.length / 3) - 1;
    const isLastIndex = pageIndex === lastIndex;
    const isFirstIndex = pageIndex === 0;
    const page = await verificationWebhookStore.getPageByFilter({
      page: {
        size: pageSize,
        index: pageIndex
      }
    });
    a.is(page.currentIndex, pageIndex, `${pageIndex}.${i}.1`);
    if (isLastIndex || isFirstIndex) {
      if (isLastIndex) a.is(page.nextIndex, null, `${pageIndex}.${i}.2`);
      if (isFirstIndex) a.is(page.prevIndex, null, `${pageIndex}.${i}.3`);
    } else {
      a.is(page.prevIndex, pageIndex - 1, `${pageIndex}.${i}.4`);
      a.is(page.nextIndex, pageIndex + 1, `${pageIndex}.${i}.5`);
    }
    if (isLastIndex) {
      const mod = webhookEntities.length % pageSize;
      if (mod === 0) {
        a.is(page.data.length, pageSize, `${pageIndex}.${i}.6`);
      } else {
        a.is(page.data.length, mod, `${pageIndex}.${i}.7`);
      }
    }
  }
  await deleteVerifiactionResult();
});

test.run();


